file_content = str(file_content)

# Settup
wav_filename = 'lorentz_attractor_sonification.wav'

# --- Sound Parameters ---
samplerate = 44100  # samples per second, standard CD quality
duration_per_point = 0.015 # Duration of each sound segment in seconds
                           # Shorter for more rapid changes
amplitude = 0.5            # Max amplitude of the waveform (0.0 to 1.0)

min_freq = 100  # Minimum audible frequency for mapping
max_freq = 1000 # Maximum audible frequency for mapping

# --- Parse the string content into a Python list ---
try:
    lorentz_data_list = ast.literal_eval(file_content)
    # Convert list of lists to a NumPy array for easier manipulation
    lorentz_data_points = np.array(lorentz_data_list, dtype=np.float32) 
    print(f"Successfully loaded {len(lorentz_data_points)} data points from the file.")
except ValueError as e:
    print(f"Error parsing the file content as a Python list: {e}")
    print("Please ensure the file contains a valid string representation of a Python list.")
    sys.exit()

# Extract the x-values for mapping
x_values = lorentz_data_points[:, 0] # Get all x values (first column)
min_x = np.min(x_values)
max_x = np.max(x_values)
range_x = max_x - min_x
if range_x == 0:
    range_x = 1 # Avoid division by zero for static data

# Create an empty numpy array to store the entire concatenated waveform
# Calculate total number of samples
total_samples = int(len(lorentz_data_points) * samplerate * duration_per_point)
full_waveform = np.zeros(total_samples, dtype=np.float32) # Use float32 for audio

# Keep track of the current position in the full_waveform array
current_sample_position = 0

print("Generating audio waveform...")
for i, point in enumerate(lorentz_data_points):
    # Map the x-coordinate to a frequency
    normalized_x = (point[0] - min_x) / range_x
    frequency = min_freq + normalized_x * (max_freq - min_freq)

    # Generate a sine wave for the current frequency segment
    num_samples_segment = int(samplerate * duration_per_point)
    t = np.linspace(0., duration_per_point, num_samples_segment, endpoint=False)
    segment_waveform = amplitude * np.sin(2 * np.pi * frequency * t)

    # Add the segment to the full waveform
    end_sample_position = current_sample_position + num_samples_segment
    # Ensure we don't go out of bounds (might happen with float rounding)
    if end_sample_position > total_samples:
        end_sample_position = total_samples
        segment_waveform = segment_waveform[:total_samples - current_sample_position]

    full_waveform[current_sample_position:end_sample_position] = segment_waveform
    current_sample_position = end_sample_position

    # Optional: Print progress
    if i % 1000 == 0: # Print every 1000 points processed
        print(f"  Processed {i}/{len(lorentz_data_points)} points...")

print("Audio waveform generation complete.")

# --- Export to WAV file ---
print(f"Exporting audio to {wav_filename}...")
try:
    sf.write(wav_filename, full_waveform, samplerate)
    print(f"Successfully saved audio to {wav_filename}")
except Exception as e:
    print(f"Error saving WAV file: {e}")
